import {
  Drawer,
  FormControl,
  List,
  ListItem,
  MenuItem,
  TextField,
  Toolbar,
  Typography,
} from "@mui/material";
import { Box } from "@mui/system";

export const Sidebar = () => {
  return (
    <Drawer
      sx={{
        width: "300px",
        flexShrink: 0,
        "& .MuiDrawer-paper": {
          width: "300px",
          boxSizing: "border-box",
        },
      }}
      variant="permanent"
      anchor="left"
    >
      <Toolbar />

      <Box sx={{ overflow: "auto" }}>
        <List>
          <Typography
            variant="h6"
            component="div"
            sx={{ fontWeight: "bold", display: "block", mb: 2 }}
          >
            Filters
          </Typography>

          <ListItem key="geograhic-resolution" sx={{ mb: 4 }}>
            <FormControl fullWidth>
              <TextField label="Geographic Resolution" select onChange={handleGeographicResolution}>
                <MenuItem value={"states"}>US States</MenuItem>
                <MenuItem value={"counties"}>US Counties</MenuItem>
              </TextField>
            </FormControl>
          </ListItem>

          <ListItem key="geograhic-filter">
            <FormControl fullWidth>
              <TextField label="Geographic Filter" select>
                {["Arizona", "Texas", "California"].map((county) => (
                  <MenuItem key={county} value={county}>
                    {county}
                  </MenuItem>
                ))}
              </TextField>
            </FormControl>
          </ListItem>
        </List>
      </Box>
    </Drawer>
  );
};
